        ///         minimum value of zero, and maximum value of
        ///         18446744073709551615.</description>
        ///     </item>
        ///     <item>
        ///         <term><see cref="Properties.UUID">UUID</see>:</term>
        ///         <description>Valid only for 'string' columns.  It
